import React from 'react';
import { Routes, Route } from 'react-router-dom'
import Campsite from './Campsite/Campsite';

function App() {
  return (
    <React.StrictMode>
      <Routes>
        <Route path='/' element={<Campsite />}/> 
      </Routes>
    </React.StrictMode>
  );
}

export default App;
